-- 音乐部分（更新为TheMine.mp3）
local function getGitSoundId(GithubSoundPath, AssetName)
    local Url = "https://github.com/LX318/LX/blob/main/TheMine.mp3?raw=true"  -- 直接使用新链接
    
    if not isfile(AssetName..".mp3") then 
        writefile(AssetName..".mp3", game:HttpGet(Url))
    end
    local Sound = Instance.new("Sound")
    Sound.SoundId = (getcustomasset or getsynasset)(AssetName..".mp3")
    Sound.Name = AssetName
    Sound.Volume = 0.5  -- 设置初始音量
    return Sound
end

local StartSound = getGitSoundId("https://github.com/LX318/LX/blob/main/TheMine.mp3", "TheMine")  -- 文件名改为TheMine
StartSound.Parent = game.Workspace
StartSound:Play()

-- 图片部分（保持不变）
local screenGui = Instance.new("ScreenGui")
screenGui.Name = "ImageDisplay"
screenGui.Parent = game.Players.LocalPlayer:WaitForChild("PlayerGui")

-- 图像原始尺寸和比例
local originalWidth = 2240
local originalHeight = 1627
local aspectRatio = originalWidth / originalHeight  -- ≈ 1.38

-- 调大显示尺寸（targetWidth=0.75，占据屏幕75%宽度）
local targetWidth = 0.75
local targetHeight = targetWidth / aspectRatio

-- 创建ImageLabel
local imageLabel = Instance.new("ImageLabel")
imageLabel.Name = "DisplayImage"
imageLabel.Image = "rbxassetid://86599702626451"
imageLabel.Size = UDim2.new(targetWidth, 0, targetHeight, 0)
imageLabel.Position = UDim2.new(0.5, 0, 0.15, 0)
imageLabel.AnchorPoint = Vector2.new(0.5, 0.5)
imageLabel.BackgroundTransparency = 1
imageLabel.ZIndex = 10
imageLabel.ScaleType = Enum.ScaleType.Fit
imageLabel.Visible = false
imageLabel.Parent = screenGui

-- 显示函数（保持不变）
local function showImage(displayTime, fadeTime)
    imageLabel.Visible = true
    imageLabel.ImageTransparency = 0
    
    wait(displayTime)
    
    local startTime = tick()
    local endTime = startTime + fadeTime
    while tick() < endTime do
        local elapsed = tick() - startTime
        local progress = elapsed / fadeTime
        imageLabel.ImageTransparency = progress
        game:GetService("RunService").Heartbeat:wait()
    end
    
    imageLabel.ImageTransparency = 1
    imageLabel.Visible = false
end

-- 使用示例
showImage(5, 2)  -- 显示5秒，淡出2秒

